    case 2
        ColourTemp=ColourTemp193102;
    case 1931
        ColourTemp=ColourTemp193102;
    case 10
        ColourTemp=ColourTemp196410;
    case 1964
        ColourTemp=ColourTemp196410;
    case 2006
        ColourTemp=ColourTemp200610;
    case 200602
        ColourTemp=ColourTemp200602;
    case 200610
        ColourTemp=ColourTemp200610;    
end

%initialize for speed
CCT_out = nan(1,size(XYZWT_,1));
duv_out = CCT_out;
for i = 1:size(XYZWT_,1)
    XYZWT = XYZWT_(i,:);

    ut=4*XYZWT(1)/(XYZWT(1)+15*XYZWT(2)+3*XYZWT(3));
    vt=6*XYZWT(2)/(XYZWT(1)+15*XYZWT(2)+3*XYZWT(3));

    dc=((ut-ColourTemp(:,2)).^2+(vt-ColourTemp(:,3)).^2).^0.5;
    if ~isnan(min(dc))
    eps=1e-8;q=find((dc>=min(dc)-eps) &(dc<=min(dc)+eps));q=q(1);vr=ColourTemp(q,3);
    Tm=ColourTemp(q,1);
    dm=dc(q);
    if Tm~=ColourTemp(end,1) ;
        T1=ColourTemp(q+1,1);
        d1=dc(q+1);
        u1=ColourTemp(q+1,2);
        v1=ColourTemp(q+1,3);
