        T1=ColourTemp(q,1);
        d1=dc(q);
        u1=ColourTemp(q,2);
        v1=ColourTemp(q,3);
    end
    if Tm~=ColourTemp(1,1) ;
        T0=ColourTemp(q-1,1);
        d0=dc(q-1);
        u0=ColourTemp(q-1,2);
        v0=ColourTemp(q-1,3);
