            signduv=1;
        end
        duv=signduv(1).*duv;

        %triangular solution
        p=((u1-u0)^2+(v1-v0)^2)^0.5;
        p1=(d0^2+p^2-d1^2)/(2*p);
        Pt=T0+p1*(T1-T0)/p;
        p3=(d0^2-p1^2)^0.5;
        p4=Pt;
        Ls=p4+(Tp-p4)*p3*1/0.001;
        if abs(p3)<0.001 %use triangular solution close to BB
            CCT=Ls;
        else
            CCT=Tp; %use parabolic solution further from BB
        end
    else
        CCT=NaN;duv=NaN;
    end
    CCT_out(1,i) = CCT;
    duv_out(1,i) = duv;
